() => {
  var data = getUserBulk.data.users;
  const fields = ['email', 'name', 'orgs', 'roles'];
  var formattedData = [];
  for (const row of data) {
    var rowData = {};
    for (const field of fields) {
      if ((field in row)) {
        rowData[field] = row[field].toString();
      }
    }
    formattedData.push(rowData);
  }
  return formattedData;
}

